/* функции */
jQuery(document).ready(function($) {

	/*$('.example-progressbar').css({
		opacity: 0,
	});*/

	$('.example-progressbar').DrSlider({
        'progressColor': '#FF0000',
        'showNavigation': false,
        'controlColor': '#fff',
        'controlBackgroundColor': '#F00',
        'duration': 8000
    });

	$('.example-progressbar').css({
		opacity: 1,
	});

	fluidvids.init({ // aктивация респонсивного видео
 		selector: ['iframe', 'object'], // runs querySelectorAll()
  		players: ['www.youtube.com', 'player.vimeo.com'] // players to support
	});

	$('.popup-gallery').magnificPopup({ // активация галлереи
      	delegate: 'a',
     	type: 'image',
    	tLoading: 'Loading image #%curr%...',
      	mainClass: 'mfp-img-mobile',
    	gallery: {
        enabled: true,
        navigateByImgClick: true,
        preload: [0,1] // Will preload 0 - before current, and 1 after the current image
      	},
        image: {
            tError: '<a href="%url%">The image #%curr%</a> could not be loaded.',
            titleSrc: function(item) {
            return item.el.attr('title') + '<small>by Marsel Van Oosten</small>';
            }
        }
    });

    $('.cr-img-gallery').imagesLoaded( function() {
        $('.popup-gallery').packery({
            itemSelector: '.cr-img-gallery',
            //transitionDuration:"0.2s",
            gutter: 0
        });
    });

    /* активация эффектов */

    $(window).fadeThis();

    /*$(document).on('ready', 'div,span', function(event) {
    	event.preventDefault();
    	 $(window).fadeThis();
    });*/
    $('.speed-500').fadeThis({speed: 500});
    $('.speed-600').fadeThis({speed: 600});
    $('.speed-700').fadeThis({speed: 700});
    $('.speed-800').fadeThis({speed: 800});
    $('.speed-900').fadeThis({speed: 900});
    $('.speed-1000').fadeThis({speed: 1000});
    $('.speed-1100').fadeThis({speed: 1100});
    $('.speed-1200').fadeThis({speed: 1200});
    $('.speed-1300').fadeThis({speed: 1300});
    $('.speed-1400').fadeThis({speed: 1400});
    $('.speed-1500').fadeThis({speed: 1500});
    $('.speed-900-distance-300').fadeThis({speed: 900,distance: 300});

    /* in single post prev&next nav*/
	$('.prev-link,.next-link').hover(function() {
		$('.shower').hide();
		$('.prevnext-url').show();
		$('.left-nav, .right-nav').animate({
			opacity: 1
			},400);
		$('.nav-post-title.left-title').animate({
			opacity: 1,
			'margin-left': 0,
			},700);
		$('.nav-post-title.right-title').animate({
			opacity: 1,
			'margin-right': 0,
			},700);		
	}, function() {
		$('.prevnext-url').fadeOut(200);	
		$('.shower').delay(350).fadeIn();
		$('.left-nav, .right-nav').animate({
			opacity: 0
			},400);
		$('.nav-post-title.left-title').animate({
			opacity: 0,
			'margin-left': +100,
			},700);
		$('.nav-post-title.right-title').animate({
			opacity: 0,
			'margin-right': +100,
			},700);	
		return false;
	});

	/* cr top sliding panel */

	$(".cr-btn-slide").click(function(){
		$("#cr-top-panel").slideToggle("slow");
		$(this).toggleClass("active fa-minus fa-caret-down"); return false;
	}); 

	/* кнопка наверх*/

	var 
	speed = 500,
	$scrollTop = $('a.scrollTop');
	$scrollTop.click(function(e){
		e.preventDefault();

		$( 'html:not(:animated),body:not(:animated)' ).animate({ scrollTop: 0}, speed );
	});

	//появление
	function show_scrollTop(){
		( $(window).scrollTop() > 300 ) ? $scrollTop.fadeIn(600) : $scrollTop.fadeOut(600);
	}
	$(window).scroll( function(){ show_scrollTop(); } );
	show_scrollTop();
	/* ФИКСИРУЕМ ХЭДЕР*/
	$('.site-branding').scrollToFixed({
		preFixed: function() { $(this).css('opacity', 0.1); },
        postFixed: function() { $(this).css('opacity', 1) }
	});

	/* ссылка в новом окне*/
    if (!document.getElementsByTagName) return;
    var anchors = document.getElementsByTagName("a");
    for (var i=0; i < anchors.length; i++) {
      if (anchors[i].getAttribute("href") && anchors[i].getAttribute("data-rel") == "new-window")
      anchors[i].target = "_blank";
    }

    /* активация слайдера */


    

    /* мобильное меню */

	$('ul#cr_main_menu').slicknav();

});